window.bookSummaryJSON = "<p><b>The first major system event has arrived as all the major factions of Earth converge....</b></p> <p>Yalsten, an old cursed land once occupied by ancient vampires, but now long forgotten, finds itself the grounds for the system event known as a Treasure Hunt.</p> <p>Follow Jake as he and the rest of his fellow Earthlings compete and cooperate in uncovering the secrets of this ancient land while naturally acquiring any and all of that sweet, sweet loot. But not without trouble.</p> <p>The ancient defenses still stand between Jake and his rightful bounty, the cursed land itself rising in opposition against the invaders. Vampires of old who have long been dormant are awakened from their slumber, with each one appearing only stronger than the one before. By that logic, Jake truly hoped for a proper final boss of this event; the only question was....</p> <p>Would he find the ultimate challenge from the vampires or his fellow man?</p> <p><b>Book five of hit Primal Hunter LitRPG series is here. Grab your copy today!</b></p> <p><b><i>The audiobook version is narrated by Travis Baldree.</i></b></p> <p><b>About the series:</b> Experience an apocalypse LitRPG with levels, classes, professions, skills, dungeons, loot, and all of the great traits of progression fantasy and LitRPG that you've come to expect. Follow Jake as he explores this new vast multiverse filled with challenges and opportunities and as he grows in power and slowly transforms from a bored office worker to a true apex hunter.</p>"; 
